collections::btree::map::BTreeMap::<K, V.doc:
Returns the number of elements in the map.

# Examples

```
use std::collections::BTreeMap;

let mut a = BTreeMap::new();
assert_eq!(a.len(), 0);
a.insert(1, "a");
assert_eq!(a.len(), 1);
```

